import forms from "./formEntrance.json";

export function getName() {
  return (
    forms.map((form)=> {

    <form>
      <label for={forms.id}> {forms.name} </label>
      <br></br>
      <input
        type={forms.type} placeholder={forms.placeholder} id={forms.id} name={forms.name}/>
    </form>
    })
  );
}
